import Home from "./pages/Home";
import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <nav>
        <div class="text-purple-600 text-2xl">
          <Link to="/">Home</Link>
          <Link to=""></Link>
        </div>
      </nav>
    </div>
  );
}

export default App;
